import React, { useState } from "react";

export default function UseReduce() {
    const [count,setcount]=useState(0)

    const increamentHandler=(e)=>{
        setcount(count+1)
    }

    const decreamentHandler=(e)=>{
        setcount(count+1)
    }
  return (
    <div>
      <button onClick={increamentHandler} className="btn btn-success">increament</button>
      <p>{count}</p>
      <button className="btn btn-danger">decreament</button>
    </div>
  );
}
